  - REJECT
  - DIRECT
  type: select
- name: 🐟 漏网之鱼
  proxies:
  - 🚀 节点选择
  - ♻️ 自动选择
  - DIRECT
  - 🇭🇰 香港节点
  - 🇨🇳 台湾节点
  - 🇸🇬 狮城节点
  - 🇯🇵 日本节点
  - 🇺🇲 美国节点
  - 🇰🇷 韩国节点
  - 🚀 手动切换
  type: select
- filter: (?i)港|HK|hk|Hong Kong|HongKong|hongkong
  include-all: true
  interval: 300
  name: 🇭🇰 香港节点
  tolerance: 50
  type: url-test
- filter: (?i)法国|FR|fr|🇫🇷|法
  include-all: true
  interval: 300
  name: 🇫🇷 法国节A点
  tolerance: 50
  type: url-test
- filter: (?i)荷兰|🇳🇱|NL|nl
  include-all: true
  interval: 300
  name: 🇳🇱荷兰A点
  tolerance: 50
  type: url-test
- filter: (?i)🇩🇪|德国|DE|de
  include-all: true
  interval: 300
  name: 🇩🇪德国A点
  tolerance: 50
  type: url-test
- filter: (?i)新加坡|🇸🇬|SG|sg
  include-all: true
  interval: 300
  name: 🇸🇬 新加坡A点
  tolerance: 50
  type: url-test
- filter: (?i)🇨🇦|CA|加拿大
  include-all: true
  interval: 300
  name: 🇨🇦 加拿大A点
  tolerance: 50
  type: url-test
- filter: (?i)日本|川日|东京|大阪|泉日|埼玉|沪日|深日|JP|Japan
  include-all: true
  interval: 300
  name: 🇯🇵 日本节点
  tolerance: 50
  type: url-test
- filter: (?i)美|波特兰|达拉斯|俄勒冈|凤凰城|费利蒙|硅谷|拉斯维加斯|洛杉矶|圣何塞|圣克拉拉|西雅图|芝加哥|US|United States
  include-all: true
  interval: 300
  name: 🇺🇲 美国节点
  tolerance: 50
  type: url-test
- filter: (?i)台|新北|彰化|TW|Taiwan
  include-all: true
  interval: 300
  name: 🇨🇳 台湾节点
  tolerance: 50
  type: url-test
- filter: (?i)新加坡|坡|狮城|SG|Singapore
  include-all: true
  interval: 300
  name: 🇸🇬 狮城节点
  tolerance: 50
  type: url-test
- filter: (?i)KR|Korea|KOR|首尔|韩|韓
  include-all: true
  interval: 300
  name: 🇰🇷 韩国节点
  tolerance: 50
  type: url-test
